    nestedSet(context.variables, variablePath, value);

}

def range(self, options) {
    context = options.context;
    params = options.params;
    variablePath = options.variablePath;
    if (params.fromOne){
        return (1..(params.size)).toList();
    }else{
        return (0..(params.size-1)).toList();
    }
}

def setBody(self, options) {
    context = options.context;
    params = options.params;
    variablePath = options.variablePath;
    self.getIn().setBody(params.body);
}

def encode(self, options) {
    context = options.context;
    params = options.params;
    variablePath = options.variablePath;
    return self.encode();
}

